import './rooms.css';

export default class Rooms extends Component {
  constructor(props){
    super();
  }
  render() {
    return (
      <div>

        <div id='rooms'>
          <div className="note">
            <p><strong>Note: </strong>For demonstration purposes, changing temperature compeletes in 10s for the best visual effect.</p>
          </div>
          <Room roomName={"Kitchen"} type="temperature"/>
          <Room roomName={"Bedroom"} type="temperature"/>
          <Room roomName={"Livingroom"} type="temperature"/>
          <Room roomName={"Bathroom"} type="temperature"/>
        </div>
      </div>
    )
  }
}
